import { Component } from '@angular/core';
import { BannerComponent } from '../banner/banner.component';
import { ProductGridComponent } from '../products/product-grid.component';

@Component({
  selector: 'app-home',
  standalone: true,
  imports: [BannerComponent, ProductGridComponent],
  templateUrl: './home.component.html'
})
export class HomeComponent {
  public bannerImages = [
    {
      url: 'https://images.unsplash.com/photo-1505843276877-1a8b1bfa2c7b?auto=format&fit=crop&w=1200&q=80',
      caption: 'Feel the IPL Fever!'
    },
    {
      url: 'https://images.unsplash.com/photo-1517649763962-0c623066013b?auto=format&fit=crop&w=1200&q=80',
      caption: 'Official Cricket Merchandise'
    },
    {
      url: 'https://images.unsplash.com/photo-1464983953574-0892a716854b?auto=format&fit=crop&w=1200&q=80',
      caption: 'Support Your Favorite IPL Team!'
    }
  ];
}
